import React from "react";
import { Form } from "react-bootstrap";

const SearchBar = props => {
  return (
    <Form
      onSubmit={e => {
        e.preventDefault();
      }}
    >
      <p>
        <input
          type="text"
          placeholder="Serach GIF..."
          onChange={props.inputHandler}
          name="searchInput"
        />
      </p>
    </Form>
  );
};

export default SearchBar;
